import React from 'react'
import { useRoutes } from 'react-router-dom';
import Blog from './pages/Blog';
import Home from './pages/Home';

export default function Routing() {
    let element = useRoutes([
        { path: "/", element: <Home /> },
        { path: "/blog", element: <Blog /> },
      ]);
      return element;
}
